1144.informacaoComplementar:
1. Desmontagem completa do alternador;
2. Inspeção completa da parte elétrica do equipamento (medição de resistência de
isolamento, resistência ôhmica das bobinas e análise termográfica);
3. Inspeção mecânica do equipamento (verificação das dimensões das tampas, eixo, rasgo
de chaveta e furo do acoplamento);
4. Revitalização completa do alternador;
5. Lavagem das bobinas com água a 45 ºC;
6. Limpeza química das bobinas com solvente desengraxante e dielétrico para retirada de
todas as impurezas;
7. Secagem em estufa com temperatura e tempo controlados;
8. Impregnação das bobinas por imersão com verniz isolante classe H 180ºC;
9. Secagem em estufa com temperatura e tempo controlados para polimerização do verniz;
10. Marinização de todo o bobinado (aplicação de tinta epóxi alta resistência à corrosão e
temperatura);
11. Limpeza e tratamento das peças;
12. Aplicação de verniz antioxidante nas partes ferrosas internas;
13. Substituição do rolamento;
14. Substituição do conjunto de diodos e varistor;
15. Montagem e testes estáticos;
16. Ensaios dinâmicos em bancada com tensão e rotação nominal;
17. Pintura final de acabamento;
18. Embalagem e entrega;
19. Mão de obra para desinstalação e instalação do alternador;
20. Transporte incluso.
